function App() {

  return (
    <div className='h-screen w-screen flex flex-row'>

    {/*PHOTO + BUTTONS DIV */}
    <div className='bg-[#50d71e] h-screen w-52'>
      <div className='flex align-center justify-center'>


      <img src={pfp} alt='pfp' className='w-20 m-4 '/>
      </div>
      PHOTTO
    </div>

    <nav className='flex justify-around w-screen'>
      <a href="/clubs" >
